{
  "title": "MongoDB network stats",
  "type": "timelion",
  "params": {
    "expression": "((.es(index='metricbeat-*',metric='sum:mongodb.status.network.in.bytes',q='metricset.module: mongodb AND type: metricsets').subtract(.es(index='metricbeat-*',metric='sum:mongodb.status.network.in.bytes',q='metricset.module: mongodb AND type: metricsets', offset=-1m))).divide(1024).label(\"MongoDB Kbytes received (per/min)\")),((.es(index='metricbeat-*',metric='sum:mongodb.status.network.out.bytes',q='metricset.module: mongodb AND type: metricsets').subtract(.es(index='metricbeat-*',metric='sum:mongodb.status.network.out.bytes',q='metricset.module: mongodb AND type: metricsets', offset=-1m))).divide(1024).label(\"MongoDB Kbytes sent (per/min)\"))",
    "interval": "1m"
  },
  "aggs": [],
  "listeners": {}
}

{
  "title": "MongoDB Journal Size stats",
  "type": "timelion",
  "params": {
    "expression": "(.es(index='metricbeat-*',metric='sum:mongodb.status.journaling.journaled.mb',q='metricset.module: mongodb AND type: metricsets').label(\"MongoDB Journaling Last Commit Size (MB)\"),.es(index='metricbeat-*',metric='sum:mongodb.status.journaling.write_to_data_files.mb',q='metricset.module: mongodb AND type: metricsets').label(\"MongoDB Journaling Write to data file (MB)\"))",
    "interval": "1m"
  },
  "aggs": [],
  "listeners": {}
}

{
